        row-cols-md-3 row-cols-sm-2 text-center'>
            <div className='col px-3 py-3'>
                <div className='card md-6 rounded'>
    { 
      props.item.map(obj=>{
        return(
           <Item
           key={obj.id}
           id={obj.id}
           myId={obj.myId}
           title={obj.title}
           description={obj.description}
           price={obj.price}
           img={obj.img}
           />
        )
      })
    }
 </div>

</div>
</div>
</main>
</div>
  )
}

export default CardItem
